window.bookSummaryJSON = "<p>The naga next door has perfect pecs, washboard abs, and the world’s sharpest jawline, but that doesn’t mean he’s off the hook for disturbing the peace.<br> <br> But this time, when I stomp over to give the my noisy neighbor a piece of my mind, I find Zayn’s front door ajar and his groceries scattered on the ground. What the—<br> <br> The sexy serpent has been hiding a curse. On a whim, I offer to help him break it.<br> <br> The more time we spend together, the more I realize he’s a lot more than a pretty face. Our chemistry is off the charts, he can cook, and more importantly, he loves my familiars. Very soon, breaking the curse isn’t about him anymore; it’s about us.<br> <br> But Zayn’s not the only one with something to hide, and I’m beginning to suspect someone out there knows my secret. And if that gets out, I’ll be in big trouble.<br> <br> <b><i>The Naga Next Door</i></b><b> is a sweet and steamy stand-alone paranormal romance featuring a naga with special \"parts\" and a mouthy witch. HEA guaranteed.</b></p>"; 
